INSERT INTO `options` (`id`, `variable`, `value`) VALUES ('13', 'sambutan_kepala_sekolah', '<p style=\"text-align:justify\">Assalamualikum Wr. Wb</p>\r\n\r\n<p style=\"text-align:justify\">Atas Berkat Rahmat Allah, Tuhan yang Maha Esa dan doa restu serta kerja keras segenap keluarga besar SMP Muhammadiyah 30, akhirnya SMP Muhammdiyah 30 mempunyai sistem informasi berbasis web&nbsp;sebagai salah satu sarana media komunikasi kepala masyarakat sekitar yang belum mengetahui SMP Muhammadiyah 30.</p>\r\n\r\n<p style=\"text-align:justify\">Pada kesempatan yang berbahagia ini,&nbsp;SMP Muhammadiyah 30 sebagai bagian dari&nbsp; publikasi, ajang silaturahmi, serta kenangan bagi alumni&nbsp;dan masyarakat pendidikan di Penggilingan&nbsp;dan sekitarnya.</p>\r\n\r\n<p style=\"text-align:justify\">Semoga ke depan SMP Muhammadiyah 30 mampu menjadi pelayan pendidikan bermutu yang mampu mengantarkan para peserta didiknya menjadi pribadi tangguh, berkarakter, juga unggul dalam berprestasi dan berakhlak mulia.</p>\r\n\r\n<p style=\"text-align:justify\">Selanjutnya kami berharap website ini dapat terus menerus memberikan fungsinya sebagai media informasi mengenai berbagai hal yang berkaiatan dengan sekolah&nbsp;SMP Muhammadiyah 30,&nbsp;Mari kita bekerja dan berkarya dengan mengharap ridho sang Kuasa dan keikhlasan yang tulus dijiwa demi anak bangsa.</p>\r\n\r\n<p style=\"text-align:justify\">Wassalamulaikum Wr. Wb</p>');
