INSERT INTO `posts` (`post_id`, `post_title`, `post_date`, `post_type`, `post_content`, `user_id`, `post_parent`, `category_id`, `post_image`, `order_pages`, `slug`, `counter`) VALUES ('1', 'Untuk Siswa kelas IX', '2017-12-03', 'pengumuman', '<p>Yang terhormat,<br />\r\nWali murid kelas IX<br />\r\nDi Jakarta</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(71, 71, 71); font-family:arial,verdana; font-size:14px\">السَّلاَمُ عَلَيْكُمْ وَرَحْمَةُ اللهِ وَبَرَكَاتُهُ</span><br />\r\nBa&#39;da salam, Semoga kita semua senantiasa sehat wal&#39;afiat serta dalam bimbingan dan ridho Allah SWT. Aamiin.<br />\r\n<br />\r\nSelanjutnya untuk meningkatkan hasil belajar siswa kelas IX mentthadapi UN 2016 - 2017, karni telah mengadakan pertemuan dengan orangtua murid kelas IX tanggal 17 September 2016 dan telah menyepakati kegiatan dan biayanya.<br />\r\n<br />\r\nMaka dengan ini kami sampaikan hasil keputusan rapat yanz telah disetujui untuk dikenakan kepada siswa dengan perincian anggaran terlampir. Seluruh pembiavaan dapat dicicil dan diserahkan kepada walikelas Kelas IX, Bapak Ferry Irawan, S.Pd, <strong>paling lambat bulan Februari 2017</strong>.<br />\r\n<br />\r\nUntuk Kegiatan Pendalaman Materi dimulai bulan Oktober 2016, jadwal dan pembagian kelas menyusul. Dimohon kepada Bapakflbu orangtua murid untuk memantau dan mendampingi kegiatan belajar siswa di rumah.<br />\r\n<br />\r\nDemikian hasil keputusan rapat ini kami sampaikan atas perhatian BapaktIbu, kami ucapkan terima kasih.<br />\r\n<span style=\"color:rgb(71, 71, 71); font-family:arial,verdana; font-size:14px\">وَالسَّلاَمُ عَلَيْكُمْ وَرَحْمَةُ اللهِ وَبَرَكَاتُهُ</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: right;\">Kepala Sekolah&nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p style=\"text-align: right;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: right;\"><br />\r\nZulheldi, S.Si&nbsp; &nbsp; &nbsp;&nbsp;<br />\r\nNBM : 1081426&nbsp; &nbsp;&nbsp;</p>', '1', '0', NULL, NULL, '0', NULL, '6');
INSERT INTO `posts` (`post_id`, `post_title`, `post_date`, `post_type`, `post_content`, `user_id`, `post_parent`, `category_id`, `post_image`, `order_pages`, `slug`, `counter`) VALUES ('2', 'Pendaftaran', '2017-12-03', 'sekilas_info', 'Pendaftaran perserta didik baru gelombang pertama telah dibuka.\r\n\r\nPendaftaran setiap hari kerja Pukul 07.00 - 14.00 WIB\r\n\r\nWaktu pendaftaran gelombang pertama : 1 Februari 2017 - 30 April 2017', '1', '0', NULL, NULL, '0', NULL, '6');
