INSERT INTO `posts` (`post_id`, `post_title`, `post_date`, `post_type`, `post_content`, `user_id`, `post_parent`, `category_id`, `post_image`, `order_pages`, `slug`, `counter`) VALUES ('6', 'Sejarah Sekolah', '2017-12-03', 'page', '<p style=\"text-align:justify\">SMP Muhammadiyah 30 didirikan pada tahun 1990 oleh majelis Dikdasmen Pimpinan Cabang Muhammdiyah Rawamangun.</p>\r\n\r\n<p style=\"text-align:justify\">Oleh karena itu, kwalitas pengajaran, manajemen dan aktifitas pengajaran di bawah pengawasan perguruan Muhammadiyah Rawamangun, dengan tenaga pengajar pilihan.</p>\r\n\r\n<p style=\"text-align:justify\">Pengajar tersebut lulusan S1 dan S2, yang memiliki idealisme serta dedikasi yang tinggi dalam menjunjung almamater Perguruan Muhammadiyah.</p>\r\n\r\n<p style=\"text-align:justify\">Kini SMP Muhammadiyah 30 lebih berpengalaman dalam mengembangkan Sumber Daya Manusia (SDM) yang berakhlak mulia dan berdaya saing tinggi sehingga lulusannya dapat diterima di SMA, SMK atau Alliyah unggulan Negeri maupun Swasta.</p>', '1', '5', NULL, NULL, '0', 'sejarah-sekolah', '27');
INSERT INTO `posts` (`post_id`, `post_title`, `post_date`, `post_type`, `post_content`, `user_id`, `post_parent`, `category_id`, `post_image`, `order_pages`, `slug`, `counter`) VALUES ('7', 'Visi dan Misi', '2017-12-03', 'page', '<p><strong>VISI</strong></p>\r\n\r\n<ul>\r\n	<li>Membentuk manusia yang unggul dalam prestasi</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>MISI</strong></p>\r\n\r\n<ul>\r\n	<li>Peningkatan prestasi akademik</li>\r\n	<li>Peningkatan prestasi di bidang porseni dan loketa</li>\r\n	<li>Peningkatan kemandirian melalui pemberdayaan IPM (OSIS)</li>\r\n	<li>Menanamkan Al-Qur&#39;an dengan peningkatan kwalitas ibadah</li>\r\n	<li>Mewujudkan perilaku akhlaqul karimah</li>\r\n</ul>', '1', '5', NULL, NULL, '0', 'visi-dan-misi', '16');
