INSERT INTO `posts` (`post_id`, `post_title`, `post_date`, `post_type`, `post_content`, `user_id`, `post_parent`, `category_id`, `post_image`, `order_pages`, `slug`, `counter`) VALUES ('32', 'Tips Belajar Efektif', '2017-12-07', 'post', '<p style=\"text-align: justify;\">Ada baiknya anda membuat persiapan yang baik buat satu semester ke depan. Tak ubahnya para peserta diri yang dituntut mempersiapkan segala keperluan, seperti buku pelajaran, buku tulis atau baju seragam. Selain itu, ada beberapa hal penting yang perlu Anda perhatikan, Pertama, tentukan target Anda di semester ini apa. Kemudian buat jadwal harian yang isinya langkah-langkah menuju target tersebut. Supaya target belajar goal-nya lebih cepat, berikut ada beberapa tips bagaimana cara belajar yang efektif, yang telah teruji oleh beberapa negera maju. Tips ini bias Anda jalankan sendiri, atau ditularkan kepada peserta didik Anda.</p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\">Seorang teman dari Amerika memberi saran belajar yang dia dapat dari ayahnya. Hari pertama sekolah, ulang kembali pelajaran yang telah didapat. Setelah itu baca singkat dua halaman materi berikutnya buat cari kerangkanya saja. Begitu pelajaran tersebut diterangkan guru esoknya, Anda sudah punya gambaran atau dasarnya, tinggal menambahkan saja apa yang belum Anda tahu. Jadi begitu pulang sekolah, tinggal mengulang saja untuk mencari kesimpulan atau ringkasan.</li>\r\n	<li style=\"text-align: justify;\">Usahakan selalu konsentrasi penuh waktu mendengarkan pelajaran yang disampaikan guru atau totor. Materi yang Anda dengar bakal mudah dipanggil lagi begitu Anda menghapal ulang pelajaran tersebut.</li>\r\n	<li style=\"text-align: justify;\">Beberapa teman juga merekomendasikan untuk mengetik ulang catatan pelajaran ke dalam komputer. Logikanya, dengan mengetik ulang catatan berarti sama saja dengan membaca ulang pelajaran yang baru saja didapat dari sekolah. Materi yang diulang tadi bisa tersimpan di memori otak buat jangka waktu yang lama. Lebih bagus lagi kalo membacanya kembali atau mempelajari catatan tersebut setelah diketik.</li>\r\n	<li style=\"text-align: justify;\">Cara lain adalah dengan membaca ulang catatan pelajaran kemudian buat kesimpulan dengan kalimat sendiri. Supaya dapat terpatri lama di memori, tulis kesimpulan tadi di secarik kertas kecil seukuran kartu nama. Kartu-kartu tersebut efektif untuk mengulang dan membaca singkat kala senggang.</li>\r\n	<li style=\"text-align: justify;\">Teman lainnya menyarankan untuk selalu menggunakan buku catatan yang berbeda pada setiap mata pelajaran. Cara ini dinilai lebih teratur sehingga pada waktu ingin mengulang suatu pelajaran kita tidak perlu lagi harus membuka semua buku.</li>\r\n	<li style=\"text-align: justify;\">Mengulang pelajaran tidak selamanya harus dengan membaca atau menulis. Mengajari teman lain tentang materi yang baru diulang bisa membuatmu selalu ingat akan materi tersebut. Bagusnya lagi, Anda menjadi lebih paham akan materi tersebut.</li>\r\n	<li style=\"text-align: justify;\">Belajar mendadak menjelang tes memang tidak efektif. Paling tidak sebulan sebelum ulangan adalah masa ideal buat mengulang pelajaran. Materi yang banyak bukan masalah. Caranya: selalu buat ringkasan atau kesimpulan pada setiap pelajaran, kalau perlu pakai tabel atau gambar ilustrasi supaya mudah diingat.</li>\r\n	<li style=\"text-align: justify;\">Ada beberapa teman di Australia yang menyukai waktu belajar pada siang hari. Maklum, badan masih segar setelah tidur cukup di malam hari, jadi semangat masih tinggi. Kondisi yang bagus tersebut tidak mereka sia-siakan begitu saja. Pagi mereka konsentrasi penuh pada pelajaran di kelas dan siangnya konsentrasi untuk mengulang kembali. Malam hari hanya mereka gunakan untuk mengerjakan aktivitas ringan atau pekerjaan rumah. Jadi tidak pernah ada kata begadang.</li>\r\n	<li style=\"text-align: justify;\">Kalau badan capek, bakal susah buat konsentrasinya. Beberapa teman menyarankan untuk libur dulu dari acara olah raga atau kegiatan fisik lainnya sehari menjelang ulangan umum.</li>\r\n	<li style=\"text-align: justify;\">Belajar sambil mendengarkan musik memang asyik. Pilih music yang tenang tapi menggugah. Musik klasik macam Beethoven ato Mozart bisa dicoba. Musik tipe ini cocok banget buat menemani kamu selama mengerjakan tugas yang jawabannya sudah pasti, seperti matematika, ilmu alam atau bahasa asing. Dijamin stamina belajar Anda akan selalu berisi dan penuh semangat.</li>\r\n</ol>\r\n\r\n<p style=\"text-align: justify;\">Memang bingung ya kalau semua orang saling memberi tahu apa yang harus dikerjakan. Paling penting adalah utamakan prioritas Anda. Karena biasanya kita menilai diri sendiri dari apa yang dirasakan, sedang orang lain hanya melihat dari apa yang telah kita hasilkan. Sementara apa yang bisa kita hasilkan hanya kita sendiri yang tahu. Jadi, buat target yang kamu percaya mampu meraihnya bukan apa yang dipikirkan orang lain. Begitu juga dengan cara belajar efektif, pilih cara baik mana yang paling pas dengan kondisi Anda. Selamat mencoba!</p>\r\n\r\n<p><br />\r\nSumber : Study Tips from Students, <a href=\"http://www.adprima.com\" target=\"_blank\">www.adprima.com</a></p>', '1', '0', '2', '525db0bf5bed7e80694c5a4dfe987e12.jpg', '0', 'tips-belajar-efektif', '3');
